import React, { Component } from 'react'

export default class Form extends Component {
  state={
    mail:"",
  }

  render() {
    return (
      <div>
        <input className="input mail" placeholder="example@gmail.com" required onChange={this.props.change}></input>
        <button className="btn submit" onClick={this.props.click}></button>
      </div>
    )
  }
}
